import React from "react";
import "../../App.css";
import Aos from "aos";
import "aos/dist/aos.css";
import { useEffect } from "react";
import {
  Container,
  Grid,
  Card,
  CardActionArea,
  CardContent,
  CardMedia,
  Typography,
} from "@material-ui/core";
import f1 from "./SyImg/bizkimiz.jpg";
import f2 from "./SyImg/contactt.jpg";
import f3 from "./SyImg/kimia-zarifi-ZA_VmLP4u-M-unsplash.jpg";

export default function Products() {
  useEffect(() => {
    Aos.init({ duration: 2000 });
    Aos.refresh();
  }, []);
  return (
    <div>
      <div className="urunler"></div>
      <Container style={{ marginTop: "10px" }}>
        <Grid container spacing={5} direction="row">
          <Grid item xs={6} md={4}>
            <>
              <CardActionArea>
                <CardMedia component="img" image={f1} height="200" />
                <CardContent></CardContent>
              </CardActionArea>
            </>
          </Grid>
        </Grid>
      </Container>
    </div>
  );
}
